import React, { useState, useEffect } from 'react';

interface VideoOverlayProps {
    onClose: () => void;
}

const VideoOverlay: React.FC<VideoOverlayProps> = ({ onClose }) => {
    const [isVisible, setIsVisible] = useState(true);

    const handleClose = () => {
        setIsVisible(false);
        setTimeout(() => {
            onClose();
        }, 300); // Wait for fade out animation
    };

    const handleOverlayClick = (e: React.MouseEvent) => {
        // Close when clicking outside the video
        if (e.target === e.currentTarget) {
            handleClose();
        }
    };

    return (
        <div 
            style={{
                position: 'fixed',
                top: 0,
                left: 0,
                width: '100vw',
                height: '100vh',
                backgroundColor: 'rgba(0, 0, 0, 0.9)',
                display: 'flex',
                justifyContent: 'center',
                alignItems: 'center',
                zIndex: 9999,
                opacity: isVisible ? 1 : 0,
                transition: 'opacity 0.3s ease-in-out',
                backdropFilter: 'blur(5px)'
            }}
            onClick={handleOverlayClick}
        >
            <div style={{
                position: 'relative',
                maxWidth: '90vw',
                maxHeight: '90vh',
                backgroundColor: '#1a1a1a',
                borderRadius: '12px',
                overflow: 'hidden',
                boxShadow: '0 20px 60px rgba(0, 0, 0, 0.5)',
                border: '2px solid rgba(255, 255, 255, 0.1)'
            }}>
                {/* Header */}
                <div style={{
                    padding: '16px 20px',
                    background: 'linear-gradient(90deg, #2a8db8 0%, #4a6fa5 100%)',
                    color: 'white',
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center'
                }}>
                    <h2 style={{
                        margin: 0,
                        fontSize: '18px',
                        fontWeight: 600,
                        letterSpacing: '0.5px'
                    }}>
                        ðŸŽ“ Autai User Guide
                    </h2>
                    <button
                        onClick={handleClose}
                        style={{
                            background: 'none',
                            border: 'none',
                            color: 'white',
                            fontSize: '24px',
                            cursor: 'pointer',
                            padding: '4px 8px',
                            borderRadius: '4px',
                            transition: 'background-color 0.2s'
                        }}
                        onMouseEnter={(e) => e.currentTarget.style.backgroundColor = 'rgba(255, 255, 255, 0.2)'}
                        onMouseLeave={(e) => e.currentTarget.style.backgroundColor = 'transparent'}
                    >
                        âœ•
                    </button>
                </div>

                {/* Video Container */}
                <div style={{
                    padding: '20px'
                }}>
                    <video
                        controls
                        autoPlay
                        style={{
                            width: '100%',
                            height: 'auto',
                            maxHeight: '70vh',
                            borderRadius: '8px',
                            outline: 'none'
                        }}
                        poster="data:image/svg+xml;base64,"
                    >
                        <source src="/media/Tutorial_1.mp4" type="video/mp4" />
                        Your browser does not support the video tag.
                    </video>
                </div>

                {/* Footer */}
                <div style={{
                    padding: '16px 20px',
                    backgroundColor: 'rgba(255, 255, 255, 0.05)',
                    borderTop: '1px solid rgba(255, 255, 255, 0.1)',
                    display: 'flex',
                    justifyContent: 'space-between',
                    alignItems: 'center'
                }}>
                    <div style={{
                        fontSize: '14px',
                        color: '#b0b8c4'
                    }}>
                        Welcome to Autai! This tutorial will help you get started with building neural networks.
                    </div>
                    <button
                        onClick={handleClose}
                        style={{
                            background: 'linear-gradient(90deg, #4a6fa5 0%, #2a8db8 100%)',
                            border: 'none',
                            color: 'white',
                            padding: '8px 16px',
                            borderRadius: '6px',
                            cursor: 'pointer',
                            fontSize: '14px',
                            fontWeight: 500,
                            transition: 'transform 0.2s',
                            boxShadow: '0 2px 8px rgba(42, 141, 184, 0.3)'
                        }}
                        onMouseEnter={(e) => e.currentTarget.style.transform = 'scale(1.05)'}
                        onMouseLeave={(e) => e.currentTarget.style.transform = 'scale(1)'}
                    >
                        Skip Tutorial
                    </button>
                </div>
            </div>
        </div>
    );
};

export default VideoOverlay;
